    <script>
      // Set image sources
      const fullTextImage = document.getElementById("fullTextImage");
      const partialTextImage = document.getElementById("partialTextImage");

      const images = ["#fullTextImage", "#partialTextImage"];
      let currentIndex = 0;
      let switchCount = 0;
      const imageWrapper = document.getElementById("images-container");

      function switchImages() {
        if (switchCount < 6) {
          document.querySelector(images[currentIndex]).style.display = "none";
          currentIndex = (currentIndex + 1) % 2;
          document.querySelector(images[currentIndex]).style.display = "block";
          switchCount++;
          setTimeout(switchImages, 1000);
        } else {
          panDown();
        }
      }

      function panDown() {
        imageWrapper.style.transform = "translateY(-68%)";
        setTimeout(reset, 8000);
      }

      function reset() {
        switchCount = 0;
        imageWrapper.style.transform = "translateY(-100px)";
        setTimeout(() => {
          setTimeout(switchImages, 1000);
        }, 3000);
      }

      // Initialize
      document.querySelector(images[0]).style.display = "block";
      setTimeout(switchImages, 1000);
    </script>
